import "../assets/main.css";
import client from '../graphql/client';
import { ApolloProvider } from '@apollo/react-hooks';

export default function App({ Component, pageProps }) {
    return (
        <ApolloProvider client={client}>
            <Component {...pageProps} />
        </ApolloProvider>
    )

}
